import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { toast } from 'react-hot-toast';
import { FiEdit, FiTrash2, FiPlus, FiSearch } from 'react-icons/fi';
import api from '../../services/api';

const statusBadges = {
  pending: 'bg-yellow-100 text-yellow-800',
  in_progress: 'bg-blue-100 text-blue-800',
  completed: 'bg-green-100 text-green-800',
  rejected: 'bg-red-100 text-red-800'
};

const MyInterests = () => {
  const [interests, setInterests] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filters, setFilters] = useState({
    status: '',
    type: '',
    search: ''
  });

  const fetchInterests = async () => {
    try {
      setLoading(true);
      const response = await api.interests.getMine(filters);
      setInterests(response.data || []);
    } catch (error) {
      console.error('Error:', error);
      toast.error('Failed to load interests');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchInterests();
  }, [filters]);

  const handleDelete = async (id) => {
    if (window.confirm('Delete this interest?')) {
      try {
        await api.interests.delete(id);
        toast.success('Interest deleted');
        fetchInterests();
      } catch (error) {
        toast.error('Failed to delete');
      }
    }
  };

  return (
    <div className="p-4">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-2xl font-bold">My Interests</h1>
        <Link to="/interests/new" className="btn btn-primary">
          <FiPlus className="mr-2" /> New Interest
        </Link>
      </div>

      {/* Filters */}
      <div className="bg-white p-4 rounded-lg shadow mb-6">
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
          <select
            name="status"
            value={filters.status}
            onChange={(e) => setFilters({...filters, status: e.target.value})}
            className="input"
          >
            <option value="">All Statuses</option>
            <option value="pending">Pending</option>
            <option value="in_progress">In Progress</option>
            <option value="completed">Completed</option>
            <option value="rejected">Rejected</option>
          </select>
          
          <select
            name="type"
            value={filters.type}
            onChange={(e) => setFilters({...filters, type: e.target.value})}
            className="input"
          >
            <option value="">All Types</option>
            <option value="house">House</option>
            <option value="car">Car</option>
            <option value="other">Other</option>
          </select>
          
          <div className="relative">
            <FiSearch className="absolute left-3 top-3 text-gray-400" />
            <input
              type="text"
              name="search"
              value={filters.search}
              onChange={(e) => setFilters({...filters, search: e.target.value})}
              placeholder="Search..."
              className="input pl-10"
            />
          </div>
        </div>
      </div>

      {/* Interests List */}
      {loading ? (
        <div className="flex justify-center p-8">
          <div className="animate-spin rounded-full h-8 w-8 border-t-2 border-b-2 border-blue-500"></div>
        </div>
      ) : interests.length === 0 ? (
        <div className="text-center p-8 bg-white rounded-lg shadow">
          <p className="text-gray-500 mb-4">No interests found</p>
          <Link to="/interests/new" className="btn btn-primary">
            <FiPlus className="mr-2" /> Create Interest
          </Link>
        </div>
      ) : (
        <div className="space-y-4">
          {interests.map((interest) => (
            <div key={interest._id} className="bg-white p-4 rounded-lg shadow">
              <div className="flex justify-between items-start">
                <div>
                  <h3 className="font-medium capitalize">{interest.type}</h3>
                  <p className="text-sm text-gray-600">{interest.notes}</p>
                  <div className="mt-2">
                    <span className={`text-xs px-2 py-1 rounded-full ${statusBadges[interest.status]}`}>
                      {interest.status.replace('_', ' ')}
                    </span>
                  </div>
                </div>
                <div className="flex space-x-2">
                  <Link to={`/interests/edit/${interest._id}`} className="text-blue-500 hover:text-blue-700">
                    <FiEdit />
                  </Link>
                  <button 
                    onClick={() => handleDelete(interest._id)}
                    className="text-red-500 hover:text-red-700"
                  >
                    <FiTrash2 />
                  </button>
                </div>
              </div>
              {interest.images?.length > 0 && (
                <div className="mt-3 flex space-x-2 overflow-x-auto">
                  {interest.images.map((img, i) => (
                    <img 
                      key={i} 
                      src={img} 
                      alt={`${interest.type} ${i + 1}`}
                      className="h-16 w-16 object-cover rounded border"
                    />
                  ))}
                </div>
              )}
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default MyInterests;
